import React, { useCallback } from "react";
import { useHistory } from "react-router-dom";

function Btn() {
  const history = useHistory();

  const handleClick = () => {
    history.push("/path/to/push");
  };

  return (
    <button type="button" onClick={{ handleClick }} name="button">
      Post a Job
    </button>
  );
}

export default Btn;
